double x3b_h2o_ion_v1::basis(const double xyz[21], double* mmm) const
{
    const double* Oa  = xyz;
    const double* Ha1 = Oa + 3;
    const double* Ha2 = Oa + 6;

    const double* Ob  = xyz + 9;
    const double* Hb1 = Ob + 3;
    const double* Hb2 = Ob + 6;

    const double* X  = xyz + 18;

    double v[21]; 

    v[0] = var_intra(m_kHH_intra, distance(Ha1, Ha2), 0.0);
    v[1] = var_intra(m_kHH_intra, distance(Hb1, Hb2), 0.0);
    v[2] = var_intra(m_kOH_intra, distance( Oa, Ha1), 0.0);
    v[3] = var_intra(m_kOH_intra, distance( Oa, Ha2), 0.0);
    v[4] = var_intra(m_kOH_intra, distance( Ob, Hb1), 0.0);
    v[5] = var_intra(m_kOH_intra, distance( Ob, Hb2), 0.0);

    v[6] =  var_main(m_kHH, distance(Ha1, Hb1), 0.0);
    v[7] = var_main(m_kHH, distance(Ha1, Hb2),  0.0);
    v[8] = var_main(m_kHH, distance(Ha2, Hb1),  0.0);
    v[9] = var_main(m_kHH, distance(Ha2, Hb2),  0.0);
    v[10] = var_main(m_kOH, distance( Oa, Hb1), 0.0);
    v[11] = var_main(m_kOH, distance( Oa, Hb2), 0.0);
    v[12] = var_main(m_kOH, distance( Ob, Ha1), 0.0);
    v[13] = var_main(m_kOH, distance( Ob, Ha2), 0.0);
    v[14] = var_main(m_kOO, distance( Oa, Ob),  0.0);
    v[15] = var_main(m_kXH, distance( X, Ha1),  0.0);
    v[16] = var_main(m_kXH, distance( X, Ha2),  0.0);
    v[17] = var_main(m_kXH, distance( X, Hb1),  0.0);
    v[18] = var_main(m_kXH, distance( X, Hb2),  0.0);
    v[19] = var_main(m_kXO, distance( X,  Oa),  0.0);
    v[20] = var_main(m_kXO, distance( X,  Ob),  0.0);

    evpoly(v, mmm);

    const double s12 = f_switch_cos(distance(Oa, Ob));
    const double s13 = f_switch_cos(distance(Oa, X));
    const double s23 = f_switch_cos(distance(Ob, X));

    const double s = s12*s13 + s12*s23 + s13*s23;

    for (size_t n = 0; n < npoly; ++n)
        mmm[n] *= s;

    return Eind3(xyz);
}

//----------------------------------------------------------------------------//

void x3b_h2o_ion_v1::set(const double* x)
{
    std::copy(x, x + npoly, m_poly);
}

//----------------------------------------------------------------------------//

double x3b_h2o_ion_v1::value(const double xyz[21]) const
{
    double mono[npoly];

    const double Ebase = basis(xyz, mono);

    double Epoly(0);
    for (size_t n = 0; n < npoly; ++n)
        Epoly += mono[n]*m_poly[n];

#ifdef DEBUG_ENERGY 
    std::cout << "Epoly = " << Epoly << std::endl;
    std::cout << "Ebase = " << Ebase << std::endl;
#endif 

    return Epoly + Ebase;
}

//----------------------------------------------------------------------------//

double x3b_h2o_ion_v1::f_switch_cos(const double& r) const
{
    if (r > m_r3f) {
        return 0.0;
    } else if (r > m_r3i) {
        const double x = (r - m_r3i)/(m_r3f - m_r3i);
        return (1.0 + std::cos(M_PI*x))/2.0;
    } else {
        return 1.0;
    }
}

//-----------------------------------------------------------------------------//

double x3b_h2o_ion_v1::f_switch_cos(const double xyz[21]) const
{
    const double s12 = f_switch_cos(distance(xyz + 0, xyz + 9));
    const double s13 = f_switch_cos(distance(xyz + 0, xyz + 18));
    const double s23 = f_switch_cos(distance(xyz + 9, xyz + 18));

    const double s = s12*s13 + s12*s23 + s13*s23;

    return s;
}

//----------------------------------------------------------------------------//

void x3b_h2o_ion_v1::set_r3i_r3f(const double& r3i, const double& r3f)
{
    m_r3i = r3i;
    m_r3f = r3f;
}

